 , {"type":[1,3,22,87] , "noms":["nourriture","cuisinée","pizza","napolitaine"],"car":"Inventée à Naples, en Italie, au 18ème siècle, considérée comme la pizza originale, elle est inscrite sur la liste du patrimoine culturel immatériel de l’humanité de l’UNESCO en 2017. Sa recette traditionnelle la fait avec des ingrédients simples mais de haute qualité : farine, eau, levure et sel. Elle doit avoir une croûte légère et croustillante, une garniture savoureuse et une pâte moelleuse au centre.","use":"Pour obtenir le label vera pizza napoletana, il faut respecter un règlement international. Une version moderne existe, c’est la pizza napolitaine contemporaine. Elle se différencie par son processus de fabrication légèrement différent. Dans un four à bois à une température élevée entre 430°c et 480°, la cuisson dure environ 60 à 90 secondes."}
